import React from 'react'
import { Nav } from 'react-bootstrap'
import { LinkContainer } from 'react-router-bootstrap'

function MultiStProgressBar({ step1, step2, step3, step4 }) {

    return (
        <div className='d-flex justify-content-center mb-4'>
            <Nav.Item>
                {step1 ? (
                    <LinkContainer style={{color: "green" ,backgroundColor: "#ffff"}} to='/cart'>
                        <Nav.Link style={{backgroundColor: "#FF0000"}}>CartItems</Nav.Link>
                    </LinkContainer>
                ) : (
                        <Nav.Link disabled>CartItems</Nav.Link>
                    )}
            </Nav.Item>

            <Nav.Item>
                {step2 ? (
                    <LinkContainer style={{color: "green"}}  to='/shipping'>
                        <Nav.Link>Shipping</Nav.Link>
                    </LinkContainer>
                ) : (
                        <Nav.Link disabled>Shipping</Nav.Link>
                    )}
            </Nav.Item>

            <Nav.Item>
                {step3 ? (
                    <LinkContainer style={{color: "green"}}  to='/payment'>
                        <Nav.Link>Payment</Nav.Link>
                    </LinkContainer>
                ) : (
                        <Nav.Link disabled>Payment</Nav.Link>
                    )}
            </Nav.Item>

            <Nav.Item>
                {step4 ? (
                    <LinkContainer style={{color: "green"}}  to='/placeorder'>
                        <Nav.Link>Place Order</Nav.Link>
                    </LinkContainer>
                ) : (
                        <Nav.Link disabled>Place Order</Nav.Link>
                    )}
            </Nav.Item>
        </div>
    )
}

export default MultiStProgressBar
